import Menu from './components/Menu';

function Home() {
    return (
        <div>
            <Menu />
            <h1>Bem vindo(a) ao projeto de react-back-avançado!</h1>
            <p>Clicando em Sobre você poderá ver um pequeno resumo de como me senti nessa tragetória com a Recode</p>
        </div>
    );
}

export default Home;
